const NavButtons = () => {
  return (
    <div className='nav-buttons'>
      <button className='encyclopedia-button'>Encyclopedia</button>
      <button className='map-button'>Map</button>
      <button className='rules-button'>Rules</button>
    </div>
  )
}

export default NavButtons
